import React from "react"
//import Bisection from "./Bisection.js"
//import { Tab, Row } from 'react-bootstrap'
//import Tabs from 'react-bootstrap/Tabs'
//import Col from 'react-bootstrap/Col'
//import Nav from 'react-bootstrap/Nav'
import Container from 'react-bootstrap/Container'

class ChooseMenu extends React.Component {
    render(){
        return(
                <div>
                    <Container>
                    <card className="center">
                        <card className="card-deck shadow shadow-lg">
                            <card>
                                <h5 className="card-header center">List of standard methods</h5>
                            </card>
                            <card className="card-body">
                            <ul className="list-unstyled">
                                <li><a>Graphical Method</a></li>
                                <li><a>Bisection Method</a></li>
                                <li><a>False-Position Method</a></li>
                                <li><a>One-Point Iteration Method</a></li>
                                <li><a>Newton-Raphson Method</a></li>
                                <li><a>Secant Method</a></li>
                            </ul>
                            </card>
                        </card>
                    </card>
                    <br/>
                    </Container>
                </div>
        )
    }
}
export default ChooseMenu;
